const today = new Date().toISOString().slice(0,10);

function isTodayDate(dateStr) {
  if (!dateStr) return false;
  if (dateStr.includes('-')) return dateStr.slice(0,10) === today;
  if (dateStr.includes('/')) {
    const [d, m, y] = dateStr.split('/');
    return `${y}-${m.padStart(2,'0')}-${d.padStart(2,'0')}` === today;
  }
  return false;
}

const results = [];
for (const item of items) {
  const j = item.json;
  // LinkedIn logic: publishedAt means it's from LinkedIn, but Date should always be 'today'
  if (j.publishedAt !== undefined && j.jobUrl && j.companyName) {
    // Only include jobs from today (in case anything old sneaks in)
    // If you want all LinkedIn jobs regardless, just remove the next line!
    if (!isTodayDate(j.publishedAt)) continue;
    results.push({
      json: {
        Date: today, // <--- THIS LINE ENSURES "Date" is always today for LinkedIn
        companyName: j.companyName || '',
        companyUrl: j.companyUrl || '',
        jobUrl: j.jobUrl || '',
        location: j.location || '',
        title: j.title || '',
        "Job description": j.description || '',
        Portal: 'LinkedIn'
      }
    });
  } else {
    // Other portals: Date is mapped from sheet, only today's included
    if (!isTodayDate(j.Date)) continue;
    results.push({
      json: {
        Date: j.Date || today,
        companyName: j.companyName || '',
        companyUrl: j.companyUrl || '',
        jobUrl: j.jobUrl || '',
        location: j.location || '',
        title: j.title || '',
        "Job description": j["Job description"] || '',
        Portal: j.Portal || 'Other Portals'
      }
    });
  }
}
return results.filter(i => i.json.title && i.json.jobUrl);
